const Faq = () => (
    <div className="faqs" id="faq">
        <h2>FAQs</h2>
      <Accordion atomic={true}>

        <AccordionItem title="WHAT IS THE VOID MARKETPLACE?">
          <DummyContentOne />
        </AccordionItem>

        <AccordionItem title="WHAT IS THE VOID PASS?">
